import React from 'react';
import './display.css';
import getOrder from './findorder';

class Display extends React.Component {
	constructor(props){
		super(props)
		this.state = {
			first:0,
			second:0,
			result:0
		}
	}

	onChangeFirst = (e) =>{
		this.setState({first:e.target.value})
		// console.log(this.state.first)
	}

	onChangeSecond = (e) =>{
		this.setState({second:e.target.value})

	}
	onClickSubmit = () => {
		this.setState({result:getOrder(this.state.first,this.state.second)})
		console.log(this.state.first)
	}

	render() {

		return(
			<div className = 'w--100'>
				<div className = ''>
					<input onChange={this.onChangeFirst} placeholder ='enter first number' type='number'/>
					<input onChange={this.onChangeSecond} placeholder ='enter second number'type='number'/>
					<button onSubmit={this.onClickSubmit}>Submit</button>
				</div>
				<div>
					<span>{`The GCD is ${this.state.result}`}</span>
				</div>
			</div>

		);
	}
}

export default Display;
